        marginTop: "285px"
    },
    h:{
        fontFamily: "SFUIDisplay-Light",
        fontSize: "30px",
        fontWeight: 300,
        lineHeight: '27px',
        marginBottom: "15px"
    },
    t:{
        color: "#acacac",
        lineHeight: "27px",
        fontFamily:"SFUIDisplay-Light",
        fontWeight: 300,
    }
});
